import React from 'react';
import {Route, Switch} from 'react-router-dom'
import HomePageComponent from './pages/homepage/component';

import './App.css';

function App() {
	return (
		<div>
			<Switch>
				<Route exact path="/" component={HomePageComponent}/>

			</Switch>
		</div>
	);
}

export default App;
